import React from 'react';
import './App.css';
import Header from './header'
import PokeCard from './pokeCard'

function App() {
  return (
    <div className="App">
      <Header></Header>

      <Grid container spacing={1}>
        <Grid container item xs={12} spacing={3}>
          <FormRow />
        </Grid>
        <Grid container item xs={12} spacing={3}>
          <FormRow />
        </Grid>
        <Grid container item xs={12} spacing={3}>
          <FormRow />
        </Grid>
      </Grid>


    </div>
  );
}

export default App;
